 this.radius * this.radius; // \u5713\u7684\u9762\u7a4d\u516c\u5f0f \n  } \n} \n\n// \u5b9a\u7fa9\u4e00\u500b\u985e\u5225`Square`\uff0c\u7e7c\u627f\u81ea`Shape`\u4e26\u5be6\u73fe`calculateArea` \nclass Square extends Shape { \n  constructor(private sideLength: number) { \n    super(); // \u8abf\u7528\u57fa\u985e\u5225`Shape`\u7684\u69cb\u9020\u51fd\u5f0f \n  } \n  \n  calculateArea(): number { \n    return this.sideLength * this.sideLength; // \u6b63\u65b9\u5f62\u7684\u9762\u7a4d\u516c\u5f0f \n  } \n} \n\n// \u4f7f\u7528\u534a\u5f91\u70ba5\u5275\u5efa\u4e00\u500b`Circle`\u7684\u5be6\u4f8b \nconst circle = new Circle(5); \nconsole.log(`\u5713\u7684\u9762\u7a4d\uff1a${circle.calculateArea()}`); // \u8f38\u51fa\uff1a'\u5713\u7684\u9762\u7a4d\uff1a78.53981633974483' \n\n// \u4f7f\u7528\u908a\u9577\u70ba4\u5275\u5efa\u4e00\u500b`Square`\u7684\u5be6\u4f8b \nconst square = new Square(4); \nconsole.log(`\u6b63\u65b9\u5f62\u7684\u9762\u7a4d\uff1a${square.calculateArea()}`); // \u8f38\u51fa\uff1a'\u6b63\u65b9\u5f62\u7684\u9762\u7a4d\uff1a16'",nt=e("https://www.typescriptlang.org/play?experimentalDecorators=true&jsx=0&module=0&ts=5.3.3&filetype=ts#code/PTAEiztRK-0ADlGgFReo0IYxg9DMKRKoAGBlAFgQwAcBTDQGH-A2PUEhzOJQTtNBVm0wGM8AbJgV1bwBciBBAE5E8GUAFgAUHgBGAZx6C8THqCbc5c0LkJFQAbwmTQoWQqUq1bTtz5CRACgCUALlAA7DgFsZRQQG4jAF8jIxAIGFg0TABhAEtBdRJSQB8-QH8jQCvAzB1iMUAyOUAz7UA-52ZrLl4BYVEjdTxNUHjE1j0iAA8+dwATLRy9QykTJgB7d3MOFSHBBwJBOIA3CtAlTriOOTdPHz8nA1CTUDkOYimnQPDAfqjACldAL-Vo7Hxc0EAQt0Bpy0ACBMBfxUAPUz2Qgb2WOxynYqs4Nt5fIJdv8TMIeBxBO5QABZXg4AB0AAUAJKgABUoB4ODicnRy1WWgJRJJZLwKzWZzAgGR1J6AI3TALJegBtFQDw+r9gqEpOEoHA7lgAI4cPDCMjpLL3XT5YqlIG2SoiMRSWr1cWS4SgNodbraB59AEjMYTKYzeaLORxTpEAAyRHcAHMieCtoIdv1jPtDsdnIzQFdbuh5Y9Xp8fv8-n7-oCbBV7HgwR4IX5oX7YUR4YjCcTSXaHc63UT8QWacWnS73Thg4Bja1ogCN9Nlc3mx-kDQVgQD+8pdAFLKgET9QBdDqAAKygQCuSoAvvTgsQSSTETwKgGj5Grm1RMRfNUAAXg8RAA7g0d0QHOPThvRkNmujWENXQ4MCyOW4ACT6bdNIjoxPAtVUycIIMCvcJAA54wAvxUALH+AHJX3ZNwAHYAA50XHABmABOFCAEYADYMOwpCABYSJQjDYIFSRwn7QAohMAd1SxxI6c51